import { takeEvery } from 'redux-saga/effects'
import { INCREMENTASYNC } from './constant.js'

function *incrementAsync(){
    console.log('abc')
}

function* sagas() {
    yield takeEvery(INCREMENTASYNC,incrementAsync)
}
export default sagas
